import './App.css';
import { Navbar } from './components/layout/Navbar';
import { Browser as Router, Rout, Switch } from 'react-router-dom';
import { Fragment } from 'react';
const App = () => {
  return (
    <div className="App">
      <Router>
        <Fragment>
          <Navbar />
        </Fragment>
      </Router>
    </div>
  );
};

export default App;
